import React from 'react';
import style from "./calendar.module.scss"
const Partner = ({data}) => {
    return (
        <div className={style.info_part_cont_shadow}>
            <div className={style.info_part_elem}>
                <div className={style.info_part_img}>
                    <img src={"http://127.0.0.1:8000/img/?path="+data.partner_logo}/>
                </div>
                <div className={style.info_part_name}>{data.partner_name}</div>
            </div>
        </div>
    );
};

export default Partner;
